import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { NavbarModule } from './compartilhamento/navbar/navbar.module';



const routes: Routes = [
  {
    // path: '',
    // loadChildren: () => import('./compartilhamento/navbar/navbar.module').then(m => m.NavbarModule)
    path: '',
    children: import('../../src/app/compartilhamento/navbar/navbar.routing.module')
  }
];
@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
